import React, { Component } from 'react'
import './Layout.css'
import Quiz from '../../'

class Layout extends Component {
  render() {
    return (
      <div className='Layout'>



        <main>
          { this.props.children }
        </main>
      </div>
    )
  }
}

export default Layout
